import React, { useState, useEffect } from 'react';
import '../styles/Projects.css';
import Carousel from './Carousel';
import * as service from '../services';

import { useNavigate } from 'react-router-dom';

function Projects(props) {

    const [projects, setProjects] = useState();
    const [email, setEmail] = useState();
    const [navData, setNavData] = useState();
    const navigator = useNavigate();

    useEffect(() => {
        let url = window.location.href;
        url = url.replace('http://', '');
        url = url.replace('https://', '');
        const email = url.split('/')[1];

        setEmail(email);

        service.getProjects(email)
            .then(response => {
                setProjects(response);
            })

        setNavData(props.nav('Projects'));

    }, [projects, props])



    return (
        <div div >
            <h1>Projects</h1>
            <div className='sub-content-section'>
                <div className='sub-content-section-main'>
                    {projects !== undefined ?
                        projects.map((item, index) => {
                            return (
                                <div className='item sub-content-item-card project-card' key={index}>
                                    <div className='icon'>
                                        <Carousel />
                                    </div>
                                    <div className='info'>
                                        <table>
                                            <tr><td>Name</td><td>{item.projects.name}</td></tr>
                                            <tr><td>Description</td><td>{item.projects.description}</td></tr>
                                            <tr><td>Technology</td><td>{item.projects.technology}</td></tr>
                                            <tr><td>Type</td><td>{item.projects.type}</td></tr>
                                            <tr><td>Company</td><td>{item.projects.associatedCompany}</td></tr>
                                        </table>
                                    </div>
                                </div>
                            )
                        }) : <></>
                    }
                </div>
            </div>
        </div >
    )
}

export default Projects
